빠른 배송도 정말 좋고요~
침대 옆에 두기에 크기도 아주 딱 알맞습니다.
별 하나를 뺀것은 서랍 속에 염색물이 자꾸 묻어나와 20번은 닦은 것과 새 가구 냄새가 다소 오래가서 입니다.;;
공정 과정에서 어쩔 수 없는 것일 수도 있지만요 ^^;;
그래도 정말 좋습니다~ 감사합ㄴㅣ다^^

가격대비 좋으시다고 하시네요.친정엄마 침대 옆 협탁으로
사드렸는데. 20900원짜리가 어쩜 튼튼하고 좋니 라고. 하시네요
전 못 봐서 모르겠어요~^^:;;

맘에듬 협탁 싸이즈라 침대옆에 놓으면 딱이겠지만
난 복층이라 매트리스 옆에 놓기엔 높아서;;;
걍 쓰고 있음
